    const [book,setbook] = useState(books);
    const [cart,setcart] = useState([]);
    console.log(cart);
  return (
    <div>
        {book.map((p)=>{
            return <OneProducts key={p.id} p={p} cart={cart} setcart = {setcart}></OneProducts>
        })}
      
    </div>
  )
}

export default AllProducts
